import * as React from 'react';
import '../Style.css';
import { styled } from '@mui/material/styles';
import { Box, Typography, Button } from '@mui/material';

// const TowerCranes = styled(Button)({
//   padding: '21px 20px',
//   textTransform: 'none',
//   height: 100,
//   fontSize: 16,
//   paddingLeft: '50px',
//   paddingRight: '50px',
//   lineHeight: 1.5,
//   borderRadius: 0,
//   color: '#505e71',
//   '&:hover': {
//     backgroundColor: '#ededed',
//   },
// });
function SettingsTowerCrane() {
  return (
    <>
      <Box sx={{
          position: 'relative', 
          width: 415,
          maxWidth: 415,
          paddingBottom: '100px',
          boxShadow: '3px 3px 7px rgba(103, 162, 206, 0.2)', 
          zIndex: 5,
        }}
      >
        <Box sx={{
          display: 'flex',
          height: 65,
          borderBottom: 2,
          borderColor: '#edf2f6',
          backgroundColor: 'blue'
        }}>

        </Box>
        <Box sx={{
          display: 'flex',
          height: 'calc(100% - 65)',
          backgroundColor: 'yellow'
        }}>
          <Box sx={{
            display: 'flex',
            borderBottom: 2,
            borderColor: '#edf2f6',
          }}>
            <Box sx={{
              display: 'flex', 
              padding: '15px 20px',
              flexDirection: 'column'}}
            >
              <Typography sx={{color: '#889ab1'}}>Search Tower Cranes...</Typography>
            </Box>
            <Box sx={{
              display: 'flex', 
              padding: '15px 20px',
              flexDirection: 'column'}}
            >
              <Typography sx={{color: '#889ab1'}}>Search Tower Cranes...</Typography>
            </Box>
            <Box sx={{backgroundColor: 'green', position: 'fixed', bottom: 0, height: 100, width: 415}}>

            </Box>
          </Box>
        </Box>
      </Box>
    </>
  );
}

export default SettingsTowerCrane;
